import React from 'react';
import { render } from '@testing-library/react';

const Counter = () => {

    return(
        <div>
            <ul>
                {Counter.map(counters => (
                    <li key = {counters.coord.id}>
                        {counters.main.humidity}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Counter;
